import styled from 'styled-components'

export const NavBarContainer = styled.nav`
background: #000;
position: fixed; 
display: flex;
flex-direction: row;
flex-wrap: nowrap; 
width: 100%; 
height: 80px;
text-align: center;
padding-left: 20px;
`

export const NavLogo = styled.div`
justify-content: flex-start;
color: white; 
line-height: 80px;
`
